We observed no significant difference in the proportion of patients who met the primary outcome of 28-day mortality between the two randomised groups (561 [22%] of 2582 patients in the azithromycin group vs 1162 [22%] of 5181 patients in the usual care group; rate ratio 097, 95% CI 087107; p=050; figure 2
). We observed similar results across all prespecified subgroups (figure 3
). In an exploratory analysis restricted to the 7093 (91%) of 7763 patients with a positive SARS-CoV-2 test result, the result was similar (rate ratio 095, 95% CI 086106; p=038).Figure 2
Effect of allocation to azithromycin on 28-day mortalityFigure 3
Effect of allocation to azithromycin on 28-day mortality by baseline characteristics
Subgroup-specific rate ratio estimates are represented by squares (with areas of the squares proportional to the amount of statistical information) and the lines through them correspond to 95% CIs. The ethnicity, days since onset, and use of corticosteroids subgroups exclude those with missing data, but these patients are included in the overall summary diamond. Information on use of corticosteroids was collected from June 18, 2020, onwards following announcement of the results of the dexamethasone comparison from the RECOVERY trial. *Includes patients receiving non-invasive ventilation.
